import React, { Component, Fragment } from 'react';
import logo from './logo.svg';
//import './home.css';
//import './login.css';
import './signup.css';
import Homepage from './components/homepage.js';
import Loginpage from "./components/loginpage.js";
import Signuppage from "./components/signuppage.js";

function App() {
  return (
    <div className="App">
		<Fragment>
				<div id="pagetitle">Treebase</div>
				<div id="signup_input1">
					<div className="fieldname">Username</div>
					<input type="text" className="inputfield" name="su_username" id="signup_username"/>
				</div>
				<div id="signup_input2">
					<div className="fieldname">Password</div>
					<input type="text" className="inputfield" name="su_password" id="signup_password"/>
				</div>
				<div id="signup_location">
				</div>
				<div id="signupbutton">Submit</div>
		</Fragment>
    </div>
  );
}

export default App;
